/****** Object:  View [dbo].[ViewEmployeeInformation]    Script Date: 4/17/2025 4:46:03 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE VIEW [dbo].[ViewEmployeeInformation]
AS
SELECT        ei.Id AS EmployeeId, ei.Id, ei.Code, ei.Salutation_E, ei.MiddleName, ei.LastName, ISNULL(LTRIM(RTRIM(ei.MiddleName)), N'') + ' ' + ISNULL(LTRIM(RTRIM(ei.LastName)), N'') AS EmpName, ISNULL(NULLIF (ej.JoinDate, N''), 
                         N'19000101') AS JoinDate, ISNULL(NULLIF (ej.ProbationEnd, N''), N'19000101') AS ProbationEnd, ISNULL(NULLIF (ej.DateOfPermanent, N''), N'19000101') AS DateOfPermanent, ISNULL(NULLIF (ej.LeftDate, N''), N'19000101') 
                         AS LeftDate, ISNULL(ees.Name, N'NA') AS EmploymentStatus, ISNULL(eet.Name, N'NA') AS EmploymentType, ISNULL(p.Name, N'NA') AS Project, ISNULL(b.Name, N'NA') AS Branch, ISNULL(d.Name, N'NA') AS Department, 
                         ISNULL(s.Name, N'NA') AS Section, ISNULL(NULLIF (et.TransferDate, N''), N'19000101') AS TransferDate, ISNULL(desig.Name, N'NA') AS Designation, ISNULL(g.Name, N'NA') AS Grade, ISNULL(ep.IsPromotion, N'False') 
                         AS IsPromotion, ISNULL(NULLIF (ep.PromotionDate, N''), N'19000101') AS PromotionDate, ISNULL(p.Id, N'0') AS ProjectId, ISNULL(s.Id, N'0') AS SectionId, ISNULL(d.Id, N'0') AS DepartmentId, ISNULL(desig.Id, N'0') 
                         AS DesignationId, ISNULL(g.Id, N'0') AS GradeId, ISNULL(b.Id, N'0') AS BranchId, ISNULL(ei.IsActive, N'False') AS IsActive, ISNULL(ei.IsArchive, N'False') AS IsArchive, ei.AttnUserId, ISNULL(ej.GrossSalary, 0) AS GrossSalary, 
                         ISNULL(ej.BasicSalary, 0) AS BasicSalary, ISNULL(ej.IsPermanent, N'False') AS IsPermanent, ISNULL(esg.PFStructureId, N'0_0') AS PFStructureId, ISNULL(esg.ProjectAllocationId, N'0_0') AS ProjectAllocationId, 
                         ISNULL(esg.SalaryStructureId, N'0_0') AS SalaryStructureId, ISNULL(esg.TaxStructureId, N'0_0') AS TaxStructureId, ISNULL(esg.EmployeeGroupId, N'0_0') AS EmployeeGroupId, ISNULL(esg.LeaveStructureId, N'0_0') 
                         AS LeaveStructureId, ISNULL(g.SL, 99) AS GradeSL, ISNULL(st.Name, N'NA') AS StepName, ISNULL(st.SL, 99) AS StepSL, empp.Gender_E AS Gender, empp.Religion, ei.PhotoName, empp.Email, ej.ProbationMonth, 
                         empp.ExpiryDate, empp.PassportNumber, empp.BloodGroup_E, empp.TIN, empp.NID, empp.SpouseName, ISNULL(ej.Other1, 0) AS Other1, ISNULL(ej.Other2, 0) AS Other2, ISNULL(ej.Other3, 0) AS Other3, ej.BankAccountName, 
                         ej.BankAccountNo, Bank.Name AS BankName, ej.AccountType, ej.Routing_No, ISNULL(ej.Other4, 0) AS Other4, ISNULL(ej.Other5, 0) AS Other5, ISNULL(s.OrderNo, 999) AS SectionOrder, ISNULL(desig.OrderNo, 999) 
                         AS DesignationOrder, ISNULL(dsg.Name, N'-') AS DesignationGroupName, ISNULL(dsg.Id, N'') AS DesignationGroupId, ISNULL(ej.IsTAXApplicable, 1) AS IsTAXApplicable, p.EndDate AS ProjectEndDate, 
                         ISNULL(empp.CorporateContactLimit, 0) AS CorporateContactLimit, ISNULL(ej.IsCarTAXApplicable, 0) AS IsCarTAXApplicable, ISNULL(ej.IsSalalryProcess, 0) AS IsSalalryProcess, ej.IsPFApplicable, ej.IsGFApplicable, 
                         ej.GFStartFrom, ej.Supervisor, ej.EmpJobType, '' AS OtherId, u.Password
FROM            dbo.EmployeeInfo AS ei LEFT OUTER JOIN
                         dbo.EmployeeJob AS ej ON ei.Id = ej.EmployeeId LEFT OUTER JOIN
                         dbo.Bank AS Bank ON ej.BankInfo = Bank.Id LEFT OUTER JOIN
                             (SELECT        dbo.EmployeeTransfer.Id, dbo.EmployeeTransfer.EmployeeId, dbo.EmployeeTransfer.BranchId, dbo.EmployeeTransfer.ProjectId, dbo.EmployeeTransfer.DepartmentId, dbo.EmployeeTransfer.SectionId, 
                                                         dbo.EmployeeTransfer.IsCurrent, dbo.EmployeeTransfer.FileName, dbo.EmployeeTransfer.Remarks, dbo.EmployeeTransfer.IsActive, dbo.EmployeeTransfer.IsArchive, dbo.EmployeeTransfer.CreatedBy, 
                                                         dbo.EmployeeTransfer.CreatedAt, dbo.EmployeeTransfer.CreatedFrom, dbo.EmployeeTransfer.LastUpdateBy, dbo.EmployeeTransfer.LastUpdateAt, dbo.EmployeeTransfer.LastUpdateFrom, 
                                                         dbo.EmployeeTransfer.TransferDate
                               FROM            dbo.EmployeeTransfer RIGHT OUTER JOIN
                                                             (SELECT        EmployeeId, MAX(TransferDate) AS TransferDate
                                                               FROM            dbo.EmployeeTransfer AS EmployeeTransfer_1
                                                               WHERE        (TransferDate <= GETDATE()) AND (IsActive = 1) AND (IsArchive = 0)
                                                               GROUP BY EmployeeId) AS MaxTransfer ON dbo.EmployeeTransfer.EmployeeId = MaxTransfer.EmployeeId AND dbo.EmployeeTransfer.TransferDate = MaxTransfer.TransferDate) AS et ON 
                         ei.Id = et.EmployeeId AND et.IsCurrent = 1 LEFT OUTER JOIN
                             (SELECT        dbo.EmployeePromotion.Id, dbo.EmployeePromotion.EmployeeId, dbo.EmployeePromotion.DesignationId, dbo.EmployeePromotion.GradeId, dbo.EmployeePromotion.StepId, dbo.EmployeePromotion.IsPromotion, 
                                                         dbo.EmployeePromotion.PromotionDate, dbo.EmployeePromotion.IsCurrent, dbo.EmployeePromotion.Remarks, dbo.EmployeePromotion.FileName, dbo.EmployeePromotion.IsActive, 
                                                         dbo.EmployeePromotion.IsArchive, dbo.EmployeePromotion.CreatedBy, dbo.EmployeePromotion.CreatedAt, dbo.EmployeePromotion.CreatedFrom, dbo.EmployeePromotion.LastUpdateBy, 
                                                         dbo.EmployeePromotion.LastUpdateAt, dbo.EmployeePromotion.LastUpdateFrom
                               FROM            dbo.EmployeePromotion RIGHT OUTER JOIN
                                                             (SELECT        EmployeeId, MAX(PromotionDate) AS PromotionDate
                                                               FROM            dbo.EmployeePromotion AS EmployeePromotion_1
                                                               WHERE        (PromotionDate <= GETDATE()) AND (IsActive = 1) AND (IsArchive = 0)
                                                               GROUP BY EmployeeId) AS MaxTransfer_1 ON dbo.EmployeePromotion.EmployeeId = MaxTransfer_1.EmployeeId AND dbo.EmployeePromotion.PromotionDate = MaxTransfer_1.PromotionDate) AS ep ON 
                         ei.Id = ep.EmployeeId AND ep.IsCurrent = 1 LEFT OUTER JOIN
                         dbo.EnumEmploymentStatus AS ees ON ej.EmploymentStatus_E = ees.Id LEFT OUTER JOIN
                         dbo.EnumEmploymentType AS eet ON ej.EmploymentType_E = eet.Id LEFT OUTER JOIN
                         dbo.Project AS p ON et.ProjectId = p.Id LEFT OUTER JOIN
                         dbo.Department AS d ON et.DepartmentId = d.Id LEFT OUTER JOIN
                         dbo.Section AS s ON et.SectionId = s.Id LEFT OUTER JOIN
                         dbo.Designation AS desig ON ep.DesignationId = desig.Id LEFT OUTER JOIN
                         dbo.DesignationGroup AS dsg ON desig.DesignationGroupId = dsg.Id LEFT OUTER JOIN
                         dbo.Grade AS g ON ep.GradeId = g.Id LEFT OUTER JOIN
                         dbo.EnumSalaryStep AS st ON ep.StepId = st.Id LEFT OUTER JOIN
                         dbo.Branch AS b ON ei.BranchId = b.Id LEFT OUTER JOIN
                         dbo.EmployeePersonalDetail AS empp ON empp.EmployeeId = ei.Id LEFT OUTER JOIN
                         dbo.EmployeeStructureGroup AS esg ON ei.Id = esg.EmployeeId LEFT OUTER JOIN
                         dbo.[User] AS u ON ei.Id = u.EmployeeId
GO
