/****** Object:  View [dbo].[ViewSalaryPreCalculation]    Script Date: 4/17/2025 4:46:03 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE VIEW [dbo].[ViewSalaryPreCalculation]
AS
SELECT        ei.Code, ISNULL(LTRIM(RTRIM(ei.MiddleName)), '') + ' ' + ISNULL(LTRIM(RTRIM(ei.LastName)), '') AS EmpName, ej.JoinDate, ej.LeftDate, p.Name Project, b.Name Branch, d .Name Department, s.Name Section, 
                         desig.Name Designation, g.Name Grade, est.Name StepName, empp.Email, empp.TIN, ej.BankAccountName, ej.BankAccountNo, Bank.Name BankName, ej.AccountType, ej.Routing_No, ISNULL(s.OrderNo, 999) SectionOrder, 
                         ISNULL(desig.OrderNo, 999) DesignationOrder, ISNULL(dsg.Id, '0') DesignationGroupId, GLCode.GLAccountCode, sal.EmployeeId EmployeeId, isnull(NULLIF (sal.SalaryHead, ''), 'NA') SalaryHead, sal.Amount, sal.ProjectId, 
                         sal.DepartmentId, sal.SectionId, sal.DesignationId, sal.FiscalYearDetailId, sal.HeadType, sal.IsEarning, sal.EmployeeStatus, sal.GradeId
FROM            (SELECT DISTINCT 
                                                    'A' AS SL, main.FiscalYearDetailId, main.ProjectId, main.DepartmentId, main.SectionId, main.DesignationId, main.EmployeeId, EmployeeStatus, GradeId, replace(EnumSalaryType.Name, ' ', '') AS SalaryHead, 
                                                    ISNULL(SUM(main.Amount), 0) AS Amount, 'Stamp' AS HeadType, 0 IsEarning
                          FROM            dbo.SalaryEarningDetail main LEFT OUTER JOIN
                                                    dbo.EnumSalaryType ON main.SalaryTypeId = dbo.EnumSalaryType.Id
                          WHERE        (main.IsEarning = 0) AND EnumSalaryType.NameTrim IN ('Stamp')
                          GROUP BY main.FiscalYearDetailId, main.ProjectId, main.DepartmentId, main.SectionId, main.DesignationId, main.EmployeeId, EmployeeStatus, GradeId, replace(EnumSalaryType.Name, ' ', '')
                          UNION ALL
                          SELECT DISTINCT 
                                                   'A' AS SL, main.FiscalYearDetailId, main.ProjectId, main.DepartmentId, main.SectionId, main.DesignationId, main.EmployeeId, EmployeeStatus, GradeId, replace(EnumSalaryType.Name, ' ', '') AS SalaryHead, 
                                                   ISNULL(SUM(main.Amount), 0) AS Amount, 'GrossDeduction' AS HeadType, 0 IsEarning
                          FROM            dbo.SalaryEarningDetail main LEFT OUTER JOIN
                                                   dbo.EnumSalaryType ON main.SalaryTypeId = dbo.EnumSalaryType.Id
                          WHERE        (main.IsEarning = 0) AND EnumSalaryType.NameTrim NOT IN ('Stamp')
                          GROUP BY main.FiscalYearDetailId, main.ProjectId, main.DepartmentId, main.SectionId, main.DesignationId, main.EmployeeId, EmployeeStatus, GradeId, replace(EnumSalaryType.Name, ' ', '')
                          UNION ALL
                          SELECT DISTINCT 
                                                   'A' AS SL, main.FiscalYearDetailId, main.ProjectId, main.DepartmentId, main.SectionId, main.DesignationId, main.EmployeeId, EmployeeStatus, GradeId, replace(EnumSalaryType.Name, ' ', '') AS SalaryHead, 
                                                   ISNULL(SUM(main.Amount), 0) AS Amount, 'Gross' AS HeadType, 1 IsEarning
                          FROM            dbo.SalaryEarningDetail main LEFT OUTER JOIN
                                                   dbo.EnumSalaryType ON main.SalaryTypeId = dbo.EnumSalaryType.Id
                          WHERE        (main.IsEarning = 1) AND EnumSalaryType.TypeName NOT IN ('other')
                          GROUP BY main.FiscalYearDetailId, main.ProjectId, main.DepartmentId, main.SectionId, main.DesignationId, main.EmployeeId, EmployeeStatus, GradeId, replace(EnumSalaryType.Name, ' ', '')
                          UNION ALL
                          SELECT DISTINCT 
                                                   'A' AS SL, main.FiscalYearDetailId, main.ProjectId, main.DepartmentId, main.SectionId, main.DesignationId, main.EmployeeId, EmployeeStatus, GradeId, replace(EnumSalaryType.Name, ' ', '') AS SalaryHead, 
                                                   ISNULL(SUM(main.Amount), 0) AS Amount, 'GrossEarning' AS HeadType, 1 IsEarning
                          FROM            dbo.SalaryEarningDetail main LEFT OUTER JOIN
                                                   dbo.EnumSalaryType ON main.SalaryTypeId = dbo.EnumSalaryType.Id
                          WHERE        (main.IsEarning = 1) AND EnumSalaryType.TypeName IN ('other')
                          GROUP BY main.FiscalYearDetailId, main.ProjectId, main.DepartmentId, main.SectionId, main.DesignationId, main.EmployeeId, EmployeeStatus, GradeId, replace(EnumSalaryType.Name, ' ', '')
                          UNION ALL
                          SELECT DISTINCT 
                                                   'I' AS SL, sl.FiscalYearDetailId, sl.ProjectId, sl.DepartmentId, sl.SectionId, sl.DesignationId, sl.EmployeeId, EmployeeStatus, GradeId, replace(elt.Name, ' ', '') AS SalaryHead, SUM(sl.LoanAmount) AS Amount, 
                                                   'Loan' AS HeadType, 0 IsEarning
                          FROM            dbo.SalaryLoanDetail AS sl LEFT OUTER JOIN
                                                   dbo.EnumLoanType AS elt ON sl.LoanType_E = elt.Id
                          GROUP BY sl.FiscalYearDetailId, sl.ProjectId, sl.DepartmentId, sl.SectionId, sl.DesignationId, sl.EmployeeId, EmployeeStatus, GradeId, elt.Name
                          UNION ALL
                          SELECT DISTINCT 
                                                   'I' AS SL, sl.FiscalYearDetailId, sl.ProjectId, sl.DepartmentId, sl.SectionId, sl.DesignationId, sl.EmployeeId, EmployeeStatus, GradeId, replace(elt.Name, ' ', '') + 'Interest' AS SalaryHead, SUM(sl.InterestAmount) 
                                                   AS Amount, 'LoanInterest' AS HeadType, 0 IsEarning
                          FROM            dbo.SalaryLoanDetail AS sl LEFT OUTER JOIN
                                                   dbo.EnumLoanType AS elt ON sl.LoanType_E = elt.Id
                          GROUP BY sl.FiscalYearDetailId, sl.ProjectId, sl.DepartmentId, sl.SectionId, sl.DesignationId, sl.EmployeeId, EmployeeStatus, GradeId, elt.Name
                          UNION ALL
                          SELECT        'C' AS SL, main.FiscalYearDetailId, main.ProjectId, main.DepartmentId, main.SectionId, main.designationId, main.EmployeeId, EmployeeStatus, GradeId, replace(edt.Name, ' ', '') AS SalaryHead, 
                                                   ISNULL(main.DeductionAmount, 0) AS Amount, 'OtherDeduction' AS HeadType, 0 IsEarning
                          FROM            dbo.SalaryOtherDeduction main LEFT OUTER JOIN
                                                   EarningDeductionType edt ON edt.Id = main.DeductionTypeId
                          UNION ALL
                          SELECT        'C' AS SL, main.FiscalYearDetailId, main.ProjectId, main.DepartmentId, main.SectionId, main.designationId, main.EmployeeId, EmployeeStatus, GradeId, replace(edt.Name, ' ', '') SalaryHead, 
                                                   ISNULL(main.EarningAmount, 0) AS Amount, 'OtherEarning' AS HeadType, 1 IsEarning
                          FROM            dbo.SalaryOtherEarning main LEFT OUTER JOIN
                                                   EarningDeductionType edt ON edt.Id = main.EarningTypeId
                          UNION ALL
                          SELECT        'C' AS SL, FiscalYearDetailId, ProjectId, DepartmentId, SectionId, designationId, EmployeeId, EmployeeStatus, GradeId, 'PFEmployee' AS SalaryHead, ISNULL(PFValue, 0) AS Amount, 'PFEmployee' AS HeadType, 
                                                   0 IsEarning
                          FROM            SalaryPFDetail
                          UNION ALL
                          SELECT        'C' AS SL, FiscalYearDetailId, ProjectId, DepartmentId, SectionId, designationId, EmployeeId, EmployeeStatus, GradeId, 'TAX' AS SalaryHead, ISNULL(TaxValue, 0) AS Amount, 'TAX' AS HeadType, 0 IsEarning
                          FROM            SalaryTaxDetail
                          UNION ALL
                          SELECT        'C' AS SL, FiscalYearDetailId, ProjectId, DepartmentId, SectionId, designationId, EmployeeId, EmployeeStatus, GradeId, 'PFEmployer' AS SalaryHead, ISNULL(PFValue, 0) AS Amount, 'PFEmployer' AS HeadType, 
                                                   1 IsEarning
                          FROM            dbo.SalaryPFDetailEmployeer) AS sal LEFT OUTER JOIN
                             (SELECT        replace(Name, ' ', '') Name, GLAccountCode
                               FROM            (SELECT DISTINCT Name, GLAccountCode
                                                         FROM            EarningDeductionType
                                                         UNION ALL
                                                         SELECT DISTINCT Name, GLAccountCode
                                                         FROM            EnumSalaryType
                                                         UNION ALL
                                                         SELECT DISTINCT Name, GLAccountCode
                                                         FROM            EnumLoanType) AS s) GLCode ON sal.SalaryHead = GLCode.Name LEFT OUTER JOIN
                         SalaryEmployee se ON sal.EmployeeId = se.EmployeeId AND sal.FiscalYearDetailId = se.FiscalYearDetailId LEFT OUTER JOIN
                         EmployeeInfo ei ON sal.EmployeeId = ei.Id LEFT OUTER JOIN
                         EmployeeJob ej ON sal.EmployeeId = ej.EmployeeId LEFT OUTER JOIN
                         Project AS p ON sal.ProjectId = p.Id LEFT OUTER JOIN
                         dbo.Branch AS b ON ei.BranchId = b.Id LEFT OUTER JOIN
                         dbo.EmployeePersonalDetail AS empp ON empp.EmployeeId = ei.Id LEFT OUTER JOIN
                         Department AS d ON sal.DepartmentId = d .Id LEFT OUTER JOIN
                         Section AS s ON sal.SectionId = s.Id LEFT OUTER JOIN
                         Designation AS desig ON ej.DesignationId = desig.Id LEFT OUTER JOIN
                         DesignationGroup AS dsg ON desig.DesignationGroupId = dsg.Id LEFT OUTER JOIN
                         Grade AS g ON sal.GradeId = g.Id LEFT OUTER JOIN
                         EnumSalaryStep AS est ON isnull(se.stepId, '') = est.Id LEFT OUTER JOIN
                         dbo.Bank AS Bank ON ej.BankInfo = Bank.Id
