                         emp.DateOfPermanent, emp.LeftDate, emp.EmploymentStatus, emp.EmploymentType, emp.Project, emp.Branch, emp.Department, emp.Section, emp.TransferDate, 
                         emp.Designation, emp.Grade, emp.IsPromotion, emp.PromotionDate, emp.ProjectId, emp.SectionId, emp.DepartmentId, emp.DesignationId, emp.GradeId, 
                         emp.BranchId, emp.IsActive, emp.IsArchive, emp.AttnUserId, emp.GrossSalary, emp.BasicSalary, emp.IsPermanent, emp.PFStructureId, emp.ProjectAllocationId, 
                         emp.SalaryStructureId, emp.TaxStructureId, emp.EmployeeGroupId, emp.LeaveStructureId, emp.GradeSL, emp.StepName, emp.StepSL, emp.Gender, emp.Religion, 
                         emp.PhotoName, emp.Email, SUM(a.Medical) AS MedicalAmount, SUM(a.Conveyance) AS ConveyanceAmount, SUM(a.Entertainment) AS EntertainmentAmount, 
                         SUM(a.HouseRent) AS HouseRentAmount, SUM(a.Gross) AS GrossAmount, SUM(a.Basic) AS BasicAmount, emp.ProbationMonth, emp.ExpiryDate, 
                         emp.PassportNumber, emp.BloodGroup_E, emp.TIN, emp.NID, emp.SpouseName
FROM            (SELECT        ei.Id, CASE WHEN st.Name = 'Medical' THEN sal.Amount ELSE 0 END AS Medical, 
                                                    CASE WHEN st.Name = 'Conveyance' THEN sal.Amount ELSE 0 END AS Conveyance, 
                                                    CASE WHEN st.Name = 'Entertainment' THEN sal.Amount ELSE 0 END AS Entertainment, 
                                                    CASE WHEN st.Name = 'House Rent' THEN sal.Amount ELSE 0 END AS HouseRent, 
                                                    CASE WHEN st.Name = 'Gross' THEN sal.Amount ELSE 0 END AS Gross, CASE WHEN st.Name = 'Basic' THEN sal.Amount ELSE 0 END AS Basic
                          FROM            dbo.EmployeeSalaryStructureDetail AS sal LEFT OUTER JOIN
                                                    dbo.EmployeeInfo AS ei ON sal.EmployeeId = ei.Id LEFT OUTER JOIN
                                                    dbo.EnumSalaryType AS st ON st.Id = sal.SalaryTypeId) AS a LEFT OUTER JOIN
                         dbo.ViewEmployeeInformation AS emp ON a.Id = emp.EmployeeId
GROUP BY emp.EmployeeId, emp.Id, emp.Code, emp.Salutation_E, emp.MiddleName, emp.LastName, emp.EmpName, emp.JoinDate, emp.ProbationEnd, 
                         emp.DateOfPermanent, emp.LeftDate, emp.EmploymentStatus, emp.EmploymentType, emp.Project, emp.Branch, emp.Department, emp.Section, emp.TransferDate, 
