                         + ' ' + ISNULL(LTRIM(RTRIM(ei.MiddleName)), N'') + ' ' + ISNULL(LTRIM(RTRIM(ei.LastName)), N'') AS EmpName, ISNULL(ei.IsActive, N'False') AS IsActive, 
