                         ISNULL(NULLIF (ej.ProbationEnd, N''), N'19000101') AS ProbationEnd, ISNULL(NULLIF (ej.DateOfPermanent, N''), N'19000101') AS DateOfPermanent, 
                         ISNULL(NULLIF (ej.LeftDate, N''), N'19000101') AS LeftDate, ISNULL(ej.GrossSalary, 0) AS GrossSalary, ISNULL(ej.BasicSalary, 0) AS BasicSalary, 
                         ISNULL(ej.IsPermanent, N'False') AS IsPermanent, ISNULL(ej.Supervisor, N'NA') AS Supervisor, ISNULL(ej.BankInfo, N'NA') AS BankInfo, ISNULL(ej.BankAccountNo, 
                         N'NA') AS BankAccountNo, ISNULL(ees.Name, N'NA') AS EmploymentStatus, ISNULL(eet.Name, N'NA') AS EmploymentType, ISNULL(p.Name, N'NA') AS Project, 
                         ISNULL(b.Name, N'NA') AS Branch, ISNULL(d.Name, N'NA') AS Department, ISNULL(s.Name, N'NA') AS Section, ISNULL(p.Id, N'0') AS ProjectId, ISNULL(s.Id, N'0') 
