                         ISNULL(NULLIF (et.TransferDate, N''), N'19000101') AS TransferDate, ISNULL(desig.Name, N'NA') AS Designation, ISNULL(g.Name, N'NA') AS Grade, 
                         ISNULL(ep.IsPromotion, N'False') AS IsPromotion, ISNULL(NULLIF (ep.PromotionDate, N''), N'19000101') AS PromotionDate, ISNULL(esg.PFStructureId, N'0_0') 
                         AS PFStructureId, ISNULL(esg.ProjectAllocationId, N'0_0') AS ProjectAllocationId, ISNULL(esg.SalaryStructureId, N'0_0') AS SalaryStructureId, 
                         ISNULL(esg.TaxStructureId, N'0_0') AS TaxStructureId, ISNULL(esg.EmployeeGroupId, N'0_0') AS EmployeeGroupId, ISNULL(esg.LeaveStructureId, N'0_0') 
                         AS LeaveStructureId, ISNULL(g.SL, 99) AS GradeSL, ISNULL(st.Name, N'NA') AS StepName, ISNULL(st.SL, 99) AS StepSL, ISNULL(empp.Email, N'NA') 
                         AS PersonalEmail, ISNULL(empp.NickName, N'NA') AS NickName, ISNULL(empp.DateOfBirth, N'NA') AS DateOfBirth, ISNULL(empp.Religion, N'NA') AS Religion, 
                         ISNULL(empp.BloodGroup_E, N'NA') AS BloodGroup, ISNULL(empp.Gender_E, N'NA') AS Gender, ISNULL(empp.MaritalStatus_E, N'NA') AS MaritalStatus, 
                         ISNULL(empp.Nationality_E, N'NA') AS Nationality, ISNULL(empp.Smoker, 0) AS Smoker, ISNULL(empp.NID, N'NA') AS NID, ISNULL(empp.PassportNumber, N'NA') 
                         AS PassportNumber, ISNULL(empp.ExpiryDate, N'NA') AS ExpiryDate, ISNULL(empp.TIN, N'NA') AS TIN, ISNULL(empp.IsDisable, 0) AS IsDisable, 
                         ISNULL(empp.KindsOfDisability, N'NA') AS KindsOfDisability, ISNULL(empp.OtherId, N'NA') AS OtherId, ISNULL(prAdd.Address, N'NA') AS PresentAddress, 
                         ISNULL(prAdd.Mobile, N'NA') AS PresentMobile, ISNULL(prAdd.District, N'NA') AS PresentDistrict, ISNULL(prAdd.Division, N'NA') AS PresentDivision, 
                         ISNULL(prAdd.Country, N'NA') AS PresentCountry, ISNULL(prAdd.City, N'NA') AS PresentCity, ISNULL(prAdd.PostalCode, N'NA') AS PresentPostalCode, 
                         ISNULL(prAdd.Phone, N'NA') AS PresentPhone, ISNULL(prAdd.Fax, N'NA') AS PresentFax, ISNULL(perAdd.Address, N'NA') AS PermanentAddress, 
                         ISNULL(perAdd.Mobile, N'NA') AS PermanentMobile, ISNULL(perAdd.District, N'NA') AS PermanentDistrict, ISNULL(perAdd.Division, N'NA') AS PermanentDivision, 
                         ISNULL(perAdd.Country, N'NA') AS PermanentCountry, ISNULL(perAdd.City, N'NA') AS PermanentCity, ISNULL(perAdd.PostalCode, N'NA') AS PermanentPostalCode, 
                         ISNULL(perAdd.Phone, N'NA') AS PermanentPhone, ISNULL(perAdd.Fax, N'NA') AS PermanentFax, ISNULL(EmCon.Name, N'NA') AS EmConName, 
                         ISNULL(EmCon.Relation, N'NA') AS EmConRelation, ISNULL(EmCon.Address, N'NA') AS EmConAddress, ISNULL(EmCon.District, N'NA') AS EmConDistrict, 
                         ISNULL(EmCon.Division, N'NA') AS EmConDivision, ISNULL(EmCon.Country, N'NA') AS EmConCountry, ISNULL(EmCon.City, N'NA') AS EmConCity, 
                         ISNULL(EmCon.PostalCode, N'NA') AS EmConPostalCode, ISNULL(EmCon.Phone, N'NA') AS EmConPhone, ISNULL(EmCon.Mobile, N'NA') AS EmConMobile, 
                         ISNULL(EmCon.Fax, N'NA') AS EmConFax, ISNULL(LeftInfo.LeftType_E, N'NA') AS LeftType, ISNULL(Edu.Degree_E, N'NA') AS EducationDegree, ISNULL(Edu.Institute, 
                         N'NA') AS EducationInstitute, ISNULL(Edu.Major, N'NA') AS EducationMajor, ISNULL(Edu.YearOfPassing, N'NA') AS EducationYearOfPassing, ISNULL(Edu.CGPA, 0) 
                         AS EducationCGPA, ISNULL(Edu.Scale, 0) AS EducationScale, ISNULL(Edu.Result, N'NA') AS EducationResult, ISNULL(Edu.Marks, 0) AS EducationMarks, 
                         ISNULL(Edu.TotalYear, 0) AS EducationTotalYear
FROM            dbo.EmployeeInfo AS ei LEFT OUTER JOIN
                         dbo.EmployeeEducation AS Edu ON ei.Id = Edu.EmployeeId AND Edu.IsLast = 1 LEFT OUTER JOIN
                         dbo.EmployeeEmergencyContact AS EmCon ON ei.Id = EmCon.EmployeeId LEFT OUTER JOIN
                         dbo.EmployeeLeftInformation AS LeftInfo ON ei.Id = LeftInfo.EmployeeId LEFT OUTER JOIN
                         dbo.EmployeePermanentAddress AS perAdd ON ei.Id = perAdd.EmployeeId LEFT OUTER JOIN
                         dbo.EmployeePresentAddress AS prAdd ON ei.Id = prAdd.EmployeeId LEFT OUTER JOIN
                         dbo.EmployeeJob AS ej ON ei.Id = ej.EmployeeId LEFT OUTER JOIN
                             (SELECT        dbo.EmployeeTransfer.Id, dbo.EmployeeTransfer.EmployeeId, dbo.EmployeeTransfer.BranchId, dbo.EmployeeTransfer.ProjectId, 
                                                         dbo.EmployeeTransfer.DepartmentId, dbo.EmployeeTransfer.SectionId, dbo.EmployeeTransfer.IsCurrent, dbo.EmployeeTransfer.FileName, 
                                                         dbo.EmployeeTransfer.Remarks, dbo.EmployeeTransfer.IsActive, dbo.EmployeeTransfer.IsArchive, dbo.EmployeeTransfer.CreatedBy, 
                                                         dbo.EmployeeTransfer.CreatedAt, dbo.EmployeeTransfer.CreatedFrom, dbo.EmployeeTransfer.LastUpdateBy, dbo.EmployeeTransfer.LastUpdateAt, 
                                                         dbo.EmployeeTransfer.LastUpdateFrom, dbo.EmployeeTransfer.TransferDate
                               FROM            dbo.EmployeeTransfer RIGHT OUTER JOIN
                                                             (SELECT        EmployeeId, MAX(TransferDate) AS TransferDate
                                                               FROM            dbo.EmployeeTransfer AS EmployeeTransfer_1
                                                               WHERE        (TransferDate <= GETDATE())
                                                               GROUP BY EmployeeId) AS MaxTransfer ON dbo.EmployeeTransfer.EmployeeId = MaxTransfer.EmployeeId AND 
                                                         dbo.EmployeeTransfer.TransferDate = MaxTransfer.TransferDate) AS et ON ei.Id = et.EmployeeId AND et.IsCurrent = 1 LEFT OUTER JOIN
                             (SELECT        dbo.EmployeePromotion.Id, dbo.EmployeePromotion.EmployeeId, dbo.EmployeePromotion.DesignationId, dbo.EmployeePromotion.GradeId, 
                                                         dbo.EmployeePromotion.StepId, dbo.EmployeePromotion.IsPromotion, dbo.EmployeePromotion.PromotionDate, dbo.EmployeePromotion.IsCurrent, 
                                                         dbo.EmployeePromotion.Remarks, dbo.EmployeePromotion.FileName, dbo.EmployeePromotion.IsActive, dbo.EmployeePromotion.IsArchive, 
                                                         dbo.EmployeePromotion.CreatedBy, dbo.EmployeePromotion.CreatedAt, dbo.EmployeePromotion.CreatedFrom, 
                                                         dbo.EmployeePromotion.LastUpdateBy, dbo.EmployeePromotion.LastUpdateAt, dbo.EmployeePromotion.LastUpdateFrom
                               FROM            dbo.EmployeePromotion RIGHT OUTER JOIN
                                                             (SELECT        EmployeeId, MAX(PromotionDate) AS PromotionDate
                                                               FROM            dbo.EmployeePromotion AS EmployeePromotion_1
                                                               WHERE        (PromotionDate <= GETDATE())
                                                               GROUP BY EmployeeId) AS MaxTransfer_1 ON dbo.EmployeePromotion.EmployeeId = MaxTransfer_1.EmployeeId AND 
                                                         dbo.EmployeePromotion.PromotionDate = MaxTransfer_1.PromotionDate) AS ep ON ei.Id = ep.EmployeeId AND ep.IsCurrent = 1 LEFT OUTER JOIN
                         dbo.EnumEmploymentStatus AS ees ON ej.EmploymentStatus_E = ees.Id LEFT OUTER JOIN
                         dbo.EnumEmploymentType AS eet ON ej.EmploymentType_E = eet.Id LEFT OUTER JOIN
                         dbo.Project AS p ON et.ProjectId = p.Id LEFT OUTER JOIN
                         dbo.Department AS d ON et.DepartmentId = d.Id LEFT OUTER JOIN
                         dbo.Section AS s ON et.SectionId = s.Id LEFT OUTER JOIN
                         dbo.Designation AS desig ON ep.DesignationId = desig.Id LEFT OUTER JOIN
                         dbo.Grade AS g ON ep.GradeId = g.Id LEFT OUTER JOIN
                         dbo.EnumSalaryStep AS st ON ep.StepId = st.Id LEFT OUTER JOIN
                         dbo.Branch AS b ON ei.BranchId = b.Id LEFT OUTER JOIN
                         dbo.EmployeePersonalDetail AS empp ON empp.EmployeeId = ei.Id LEFT OUTER JOIN
                         dbo.EmployeeStructureGroup AS esg ON ei.Id = esg.EmployeeId
