GO

CREATE VIEW [dbo].[ViewEmployeeAttendance]
AS
SELECT DISTINCT 
                         al.UserID, al.PunchDate AS AttnDate, ISNULL(InTime.InPunchTime, '0000') AS InPunchTime, ISNULL(OutTime.OutPunchTime, '0000') AS OutPunchTime, 
                         atts.LunchTime, atts.LunchBreak, ei.Code, ei.EmpName, ei.Project, ei.Department,ei.Section, ei.Designation, ei.JoinDate, ei.ProjectId, ei.DepartmentId,ei.SectionId, ei.DesignationId, 
                         ei.Id AS EmployeeId, CASE WHEN isnull(Intime.InPunchTime, '0000') = '0000' THEN 0 WHEN isnull(OutTime.OutPunchTime, '0000') 
                         = '0000' THEN 0 WHEN OutTime.OutPunchTime > (atts.LunchTime + atts.LunchBreak) THEN datediff(MINUTE, CONVERT(time, stuff(isnull(Intime.InPunchTime, '0000'), 
                         3, 0, ':')), CONVERT(time, stuff(isnull(OutTime.OutPunchTime, '0000'), 3, 0, ':'))) - atts.LunchBreak WHEN OutTime.OutPunchTime >= (atts.LunchTime + atts.LunchBreak)
                          AND OutTime.OutPunchTime <= (atts.LunchTime + atts.LunchBreak) THEN datediff(MINUTE, CONVERT(time, stuff(isnull(Intime.InPunchTime, '0000'), 3, 0, ':')), 
                         CONVERT(time, stuff(isnull(atts.LunchTime, '0000'), 3, 0, ':'))) WHEN OutTime.OutPunchTime < (atts.LunchTime) THEN datediff(MINUTE, CONVERT(time, 
                         stuff(isnull(Intime.InPunchTime, '0000'), 3, 0, ':')), CONVERT(time, stuff(isnull(OutTime.OutPunchTime, '0000'), 3, 0, ':'))) END AS WorkingHour, ISNULL(ei.IsActive, 
                         'False') AS IsActive, ISNULL(ei.IsArchive, 'False') AS IsArchive, CASE WHEN DATEDIFF(n, DATEADD(n, atts.InGrace, 
                         SUBSTRING(CAST(atts.InTime + 10000 AS varchar), 2, 2) + ':' + SUBSTRING(CAST(atts.InTime + 10000 AS varchar), 4, 2)), 
                         SUBSTRING(CAST(ISNULL(InTime.InPunchTime, '0000') + 10000 AS varchar), 2, 2) + ':' + SUBSTRING(CAST(ISNULL(InTime.InPunchTime, '0000') + 10000 AS varchar), 
                         4, 2)) > 0 THEN DATEDIFF(n, DATEADD(n, atts.InGrace, SUBSTRING(CAST(atts.InTime + 10000 AS varchar), 2, 2) 
                         + ':' + SUBSTRING(CAST(atts.InTime + 10000 AS varchar), 4, 2)), SUBSTRING(CAST(ISNULL(InTime.InPunchTime, '0000') + 10000 AS varchar), 2, 2) 
                         + ':' + SUBSTRING(CAST(ISNULL(InTime.InPunchTime, '0000') + 10000 AS varchar), 4, 2)) ELSE 0 END AS lateMin
FROM            dbo.AttLogs AS al LEFT OUTER JOIN
                             (SELECT DISTINCT al.UserID, al.PunchDate, MIN(al.PunchTime) AS InPunchTime
                               FROM            dbo.AttLogs AS al LEFT OUTER JOIN
                                                         dbo.AttendanceStructure AS ats ON al.AttendanceStructureId = ats.Id
                               WHERE        (al.PunchTime <= ats.InTimeEnd)
                               GROUP BY al.UserID, al.PunchDate) AS InTime ON al.UserID = InTime.UserID AND al.PunchDate = InTime.PunchDate LEFT OUTER JOIN
                             (SELECT DISTINCT al.UserID, al.PunchDate, MAX(al.PunchTime) AS OutPunchTime
                               FROM            dbo.AttLogs AS al LEFT OUTER JOIN
                                                         dbo.AttendanceStructure AS ats ON al.AttendanceStructureId = ats.Id
                               WHERE        (al.PunchTime > ats.InTimeEnd)
                               GROUP BY al.UserID, al.PunchDate) AS OutTime ON al.UserID = OutTime.UserID AND al.PunchDate = OutTime.PunchDate LEFT OUTER JOIN
                         dbo.ViewEmployeeInformation AS ei ON ei.AttnUserId = al.UserID LEFT OUTER JOIN
                         dbo.AttendanceStructure AS atts ON al.AttendanceStructureId = atts.Id
