SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE VIEW [dbo].[ViewEmployeeEarningLeave]
AS
SELECT fyd.PeriodName, eoe.Id, eoe.EmployeeId, eoe.FiscalYearDetailId, eoe.SalaryPreiodId, eoe.DeductionAmount, eoe.DeductionDate, eoe.Remarks, emp.EmpName, emp.Code, emp.Salutation_E, emp.MiddleName, emp.LastName, 
                  emp.JoinDate, emp.ProbationEnd, emp.DateOfPermanent, emp.EmploymentStatus, emp.EmploymentType, emp.Branch, emp.TransferDate, emp.Grade, emp.IsPromotion, emp.PromotionDate, emp.GradeId, emp.BranchId, emp.GrossSalary, 
                  emp.BasicSalary, emp.IsActive, emp.IsArchive, eoe.ProjectId, eoe.DepartmentId, eoe.SectionId, eoe.DesignationId, p.Name AS Project, d.Name AS Department, s.Name AS Section, desig.Name AS Designation, Grd.Name AS GradeName, 
                  Grd.SL AS GradeSL, stp.Name AS StepName, stp.SL AS StepSL, eoe.GrossSalary AS Expr1, eoe.BasicSalary AS Expr2, eoe.Days
FROM     dbo.EmployeeEarningLeave AS eoe LEFT OUTER JOIN
                  dbo.FiscalYearDetail AS fyd ON eoe.FiscalYearDetailId = fyd.Id LEFT OUTER JOIN
                  dbo.Project AS p ON eoe.ProjectId = p.Id LEFT OUTER JOIN
                  dbo.Department AS d ON eoe.DepartmentId = d.Id LEFT OUTER JOIN
                  dbo.Section AS s ON eoe.SectionId = s.Id LEFT OUTER JOIN
                  dbo.Designation AS desig ON eoe.DesignationId = desig.Id LEFT OUTER JOIN
                  dbo.ViewEmployeeInformation AS emp ON emp.Id = eoe.EmployeeId LEFT OUTER JOIN
                  dbo.Grade AS Grd ON Grd.Id = emp.GradeId LEFT OUTER JOIN
                  dbo.EmployeePromotion AS ep ON emp.Id = ep.EmployeeId AND ep.IsCurrent = 1 LEFT OUTER JOIN
                  dbo.EnumSalaryStep AS stp ON ep.StepId = stp.Id
GO
/****** Object:  View [dbo].[ViewEmployeeSalaryStructureDetailTIB]    Script Date: 4/17/2025 4:46:03 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE VIEW [dbo].[ViewEmployeeSalaryStructureDetailTIB]
AS
SELECT DISTINCT EmployeeId, SUM(Basic) AS Basic, SUM(Medical) AS Medical, SUM(HouseRent) AS HouseRent, SUM(TA) AS TA
FROM        (SELECT DISTINCT 
                                     EmployeeId, CASE WHEN SalaryType = 'Basic' THEN Amount ELSE 0 END AS Basic, CASE WHEN SalaryType = 'Medical' THEN Amount ELSE 0 END AS Medical, CASE WHEN SalaryType = 'HouseRent' THEN Amount ELSE 0 END AS HouseRent, 
                                     CASE WHEN SalaryType = 'Conveyance' THEN Amount ELSE 0 END AS TA
                   FROM        dbo.EmployeeSalaryStructureDetail
                   WHERE     (IsCurrent = 1)) AS a
GROUP BY EmployeeId
GO
