                  s.Step26Amount, s.Step27Amount, s.Step28Amount, s.Step29Amount, s.Step30Amount, s.Step31Amount, s.Remarks, s.IsActive, s.IsArchive, s.CreatedBy, s.CreatedAt, s.CreatedFrom, s.LastUpdateBy, s.LastUpdateAt, s.LastUpdateFrom, s.Step1_5Amount, s.Step2_5Amount, 
                  s.Step3_5Amount, s.Step4_5Amount, s.Step5_5Amount, s.Step6_5Amount, s.Step7_5Amount, s.Step8_5Amount, s.Step9_5Amount, s.Step10_5Amount, s.Step11_5Amount, s.Step12_5Amount, s.Step13_5Amount, s.Step14_5Amount, s.Step15_5Amount, s.Step16_5Amount, 
                  s.Step17_5Amount, s.Step18_5Amount, s.Step19_5Amount, s.Step20_5Amount, s.Step21_5Amount, s.Step22_5Amount, s.Step23_5Amount, s.Step24_5Amount, s.Step25_5Amount, s.Step26_5Amount, s.Step27_5Amount, s.Step28_5Amount, s.Step29_5Amount, s.Step30_5Amount, 
