                {
                    currConn.Open();
                }

                #endregion open connection and transaction

                sqlText = @"

    SELECT 
    CompanySl,
    CompanyID,
    CompanyName,
    DatabaseName,
    ActiveStatus,
    Serial
    FROM CompanyInformations
    where (ActiveStatus = @ActiveStatus)	
     and  (SysVersion = @SysVersion)	
    and (CompanyName<>'NA')

