                if (!objCommCompanyList.Parameters.Contains("@SysVersion"))
                { objCommCompanyList.Parameters.AddWithValue("@SysVersion", SysVersion); }
                else { objCommCompanyList.Parameters["@SysVersion"].Value = SysVersion; }

